import './App.css';
//import HandWave from './assets/hand-regular.svg'
//import NewWave from './assets/hand-wave.png'
import TitleType from './components/TitleType';
import CardScroll from './components/CardScroll';

function App() {
  return (
    <div className='App'>
      <TitleType id='home' title={"hi, i'm salwa"} size='10vw'/>
      <p className='textArea'>
        here's a little bit about me.
      </p>
      <TitleType id='about-me' title={"about me"} size='5vw'/>
      <p className='textArea'>
        My name is Salwa Jeries, I'm a sophomore studying computer science at The University of Alabama in Huntsville. I have a background in cyber security and love to make cool websites. I want to explore software engineering and web development for a career so that I can make fun projects - like this site - for others to enjoy as well! In my free time, I like to play piano, cuddle with my hot dog (Lily), and checkout all the new local coffee shops around town!
      </p>
      <TitleType id='projects' title={"projects"} size='5vw'/>
      <CardScroll/>
    </div>
  );
}

export default App;

